  function scrollWindow()
  {
    if (stage.mouseX/ratio >= 100)
    {
        if (stage.mouseX/ratio > 400)
        {
            scrollSpeed = (400 - stage.mouseX/ratio) / 2;
            if (self.x + scrollSpeed <= 0)
            {
                self.x = 0;
            }
            else
            {
                self.x = self.x + scrollSpeed;
            } // end if
        } // end else if
    }
    else
    {
        scrollSpeed = (100 - stage.mouseX/ratio) / 2;
        self.scrollHint.visible = false;
        if (self.x + scrollSpeed >= 1000)
        {
            self.x = 1000;
        }
        else
        {
            self.x = self.x + scrollSpeed;
        } // end else if
    } // end else if
   } // End of the function
   function adjustSlide()
   {
    delX = stage.mouseX/ratio - self.x - baseX;
    delY = stage.mouseY/ratio - self.y - baseY;
    dist = Math.sqrt(delX * delX + delY * delY);
    radians = Math.atan(delY / delX);
    if (delX < 0)
    {
        radians = radians + 3.141593E+000;
    } // end if
    if (!(radians < -1.047198E+000 || radians > 1.570796E+000))
    {
        if (radians > -2.617994E-001)
        {
            radians = -2.617994E-001;
        } // end if
    }
    else
    {
        radians = -1.047198E+000;
    } // end else if
    positionTurtle();
    drawSlide();
    self.x = self.x - self.x / 4;
   } // End of the function
   function positionTurtle()
   {
    self.side1.rotation = self.side2.rotation = self.turtle.rotation = 180 * radians / 3.141593E+000;
    self.side1.scaleX = self.side2.scaleX = dist/100;
    self.turtle.x = baseX + dist * Math.cos(radians);
    self.turtle.y = baseY + dist * Math.sin(radians);
   } // End of the function
   function drawSlide()
   {
    self.middle.graphics.clear();
    self.middle.graphics.beginStroke("rgba(0, 0, 0, 0)").setStrokeStyle(0);
    self.middle.graphics.beginFill("rgba(72, 72, 72, 0.15)"); 
    self.middle.graphics.moveTo(self.side1.x, self.side1.y);
    self.middle.graphics.lineTo(self.side2.x, self.side2.y);
    self.middle.graphics.lineTo(self.side2.x + dist * Math.cos(radians) + topLength, self.side2.y);
    self.middle.graphics.lineTo(self.side1.x + dist * Math.cos(radians) + topLength, self.side1.y);
    self.middle.graphics.endFill();
    self.middle.graphics.beginStroke("rgb(72, 72, 72)").setStrokeStyle(1); 
    self.middle.graphics.beginFill("rgb(170, 170, 170)");
    self.middle.graphics.moveTo(self.side1.x, self.side1.y);
    self.middle.graphics.lineTo(self.side2.x, self.side2.y);
    self.middle.graphics.lineTo(self.side2.x + dist * Math.cos(radians), self.side2.y + dist * Math.sin(radians));
    self.middle.graphics.lineTo(self.side1.x + dist * Math.cos(radians), self.side1.y + dist * Math.sin(radians));
    self.middle.graphics.endFill();
    self.middle.graphics.beginFill("rgb(187, 187, 187)");
    self.middle.graphics.moveTo(self.side2.x + dist * Math.cos(radians), self.side2.y + dist * Math.sin(radians));
    self.middle.graphics.lineTo(self.side1.x + dist * Math.cos(radians), self.side1.y + dist * Math.sin(radians));
    self.middle.graphics.lineTo(self.side1.x + dist * Math.cos(radians) + topLength, self.side1.y + dist * Math.sin(radians));
    self.middle.graphics.lineTo(self.side2.x + dist * Math.cos(radians) + topLength, self.side2.y + dist * Math.sin(radians));
    self.middle.graphics.endFill();
    self.stilt1.x = self.side1.x + dist * Math.cos(radians);
    self.stilt1.y = self.side1.y + dist * Math.sin(radians);
    self.stilt1.height = self.side1.y - self.stilt1.y;
    self.stilt2.x = self.side2.x + dist * Math.cos(radians);
    self.stilt2.y = self.side2.y + dist * Math.sin(radians);
    self.stilt2.height = self.side2.y - self.stilt2.y;
   } // End of the function
   function startSlide(evt)
   {
    radians2 = -1.570796E+000 - radians;
    speed = gravity * Math.cos(radians2);
    accelX = speed * Math.sin(radians2);
    accelY = speed * Math.cos(radians2);
    velX = velX + accelX;
    velY = velY + accelY;
    speed = Math.sqrt(velX * velX + velY * velY);
    self.turtle.x = self.turtle.x + velX;
    self.turtle.y = self.turtle.y + velY;
    if (self.turtle.y >= baseY)
    {
        self.turtle.y = baseY;
        evt.remove();
        self.on("tick", finishSlide);
    } // end if
   } // End of the function
   function finishSlide(evt)
   {
    if (turtleSlide == 1)
    {
        sndSkid.play();
        turtleSlide = 0;
    } // end if
    if (speed > 2)
    {
        ++mudDepth;
        self["mud" + mudDepth] = new lib.sprite7Mud(); //attachMovie("Mud", "mud" + mudDepth, mudDepth);
        self.muds.addChild(self["mud" + mudDepth]);
        self["mud" + mudDepth].x = self.turtle.x;
        self["mud" + mudDepth].y = self.turtle.y + Math.random() * 6 - 3;
    } // end if
    self.turtle.rotation = self.turtle.rotation - self.turtle.rotation / 4;
    if (speed >= 5)
    {
        speed = speed * fastDamp;
    }
    else
    {
        speed = speed * slowDamp;
    } // end else if
    self.turtle.x = self.turtle.x - speed;
    if (speed < 5.000000E-002)
    {
        score = Math.round((200 - Math.abs(self.turtle.x - self.target.x)) / 2);
        if (score >= 0)
        {
            if (score >= 50)
            {
                turtle_yeah.play();
                self.parent.starPoints.score();
            }
            else
            {
                turtle_haha.play();
                self.parent.starPoints.score();
            } // end else if
        }
        else
        {
            turtle_haha.play();
            self.parent.gotoAndPlay("reset");
        } // end else if
        if (score < 0)
        {
            score = 0;
        } // end if
        evt.remove();
    } // end if
    self.pointer.x = self.turtle.x;
    if (self.pointer.alpha < 1)
    {
        self.pointer.alpha = self.pointer.alpha + 0.1;
    } // end if
    if (self.turtle.x < 500 / 4)
    {
        self.x = 500 / 4 - self.turtle.x;
    } // end if
  } // End of the function
  
